    value: 'The Treasurer of the Stinson Morrison Hecker Political Actions Committee
      (PAC), Phillip Fraas, has provided exempt legal and accounting services during
      the second half of 2013, and the PAC is hereby reporting the receipt of these
      services, as provided for in 11C.F.R. 104.3(h).  Following is a description
      of the value of the time spent in providing the services.  Mr. Fraas''s employer,
      Stinson Morrison Hecker pays Mr. Fraas primarily based on his receipt of payments
      from clients for his provision of legal services to them. Since the services
      being reported here are provided ''gratis'' to the PAC and since the firm is
      not paying him directly for providing those services, the value of his exempt
      legal and accounting services for the purposes of the report can''t be determined
      by billings or collection on the hours worked in providing those services.  However,
      Mr. Fraas recorded an estimated 1,000 hours of work in the second half of 2013
