      providing the exempt legal and accounting services.  The % of total hours spent
      on the exempt services comes to approximately 0.9% and 0.9% of $90,000.00 is
      $810.00.  Thus, Mr. Fraas values his exempt services during the second half
      of the year at $810.00.

